台大婦產科醫師施景中日前在臉書爆料，有教學醫院的主任向他透露，某第一階罷免達標的立委因為其助理帶小孩看病感覺醫院「服務不周」，所以發文把國健署、健保署的署長以及醫院副院長、醫師叫到辦公室亂罵一通。
